INSERT INTO `fracciones` (`id_fraccion`, `id_articulo`, `fraccion`, `descrip_frac`, `fundamentacion_ltg`) VALUES
(1, 1, 'I', 'El marco normativo aplicable al sujeto obligado, en el que deberá incluirse leyes, códigos, reglamentos, decretos de creación, manuales administrativos, reglas de operación, criterios, políticas, entre otros; ', 'Aplica....'),
(2, 1, 'II', 'Su estructura orgánica completa, en un formato que permita vincular cada parte de la estructura, las atribuciones y responsabilidades que le corresponden a cada servidor público, prestador de servicios profesionales o miembro de los sujetos obligados, de conformidad con las disposiciones aplicables', 'Aplica siempre'),
(3, 1, 'III', 'Las facultades de cada área; ', ''),
(4, 1, 'IV', 'Las metas y objetivos de las áreas, de conformidad con sus programas operativos', ''),
(5, 1, 'V', 'Los indicadores relacionados con temas de interés público o trascendencia social que conforme a sus funciones, deban establecer', ''),
(6, 1, 'VI', 'Los indicadores que permitan rendir cuenta de sus objetivos y resultados', ''),
(7, 1, 'VII', 'El directorio de todos los servidores públicos, a partir del nivel de jefe de departamento o su equivalente, o de menor nivel, cuando se brinde atención al público; manejen o apliquen recursos públicos; realicen actos de autoridad o presten servicios profesionales bajo el régimen de confianza u honorarios y personal de base. El directorio deberá incluir, al menos el nombre, cargo o nombramiento asignado, nivel del puesto en la estructura orgánica, fecha de alta en el cargo, número telefónico, domicilio para recibir correspondencia y dirección de correo electrónico oficiales', ''),
(8, 1, 'VIII', 'La remuneración bruta y neta de todos los servidores públicos de base o de confianza, de todas las percepciones, incluyendo sueldos, prestaciones, gratificaciones, primas, comisiones, dietas, bonos, estímulos, ingresos y sistemas de compensación, señalando la periodicidad de dicha remuneración', ''),
(9, 1, 'IX', 'Los gastos de representación y viáticos, así como el objeto e informe de la comisión correspondiente', ''),
(10, 1, 'X', 'El número total de las plazas y del personal de base y confianza, especificando el total de las vacantes, por nivel de puesto, para cada unidad administrativa', ''),
(11, 1, 'XI', 'Las contrataciones de servicios profesionales por honorarios, señalando los nombres de los prestadores de servicios, los servicios contratados, el monto de los honorarios y el periodo de contratación', ''),
(12, 1, 'XII', 'La información, en versión pública, de las declaraciones patrimoniales de los servidores públicos que así lo determinen, en los sistemas habilitados para ello, de acuerdo a la normatividad aplicable', ''),
(13, 1, 'XIII', 'El domicilio de la Unidad de Transparencia, además de la dirección electrónica donde podrán recibirse las solicitudes para obtener la información', ''),
(14, 1, 'XIV', 'Las convocatorias a concursos para ocupar cargos públicos y los resultados de los mismos', ''),
(15, 1, 'XV', 'La información de los programas de subsidios, estímulos y apoyos, en el que se deberá informar respecto de los programas de transferencia, de servicios, de infraestructura social y de subsidio', ''),
(16, 1, 'XVI', 'Las condiciones generales de trabajo, contratos o convenios que regulen las relaciones laborales del personal de base o de confianza, así como los recursos públicos económicos, en especie o donativos, que sean entregados a los sindicatos y ejerzan como recursos públicos', ''),
(17, 1, 'XVII', 'La información curricular, desde el nivel de jefe de departamento o equivalente, hasta el titular del sujeto obligado, así como, en su caso, las sanciones administrativas de que haya sido objeto; ', ''),
(18, 1, 'XVIII', 'El listado de servidores públicos con sanciones administrativas definitivas, especificando la causa de sanción y la disposición', ''),
(19, 1, 'XIX', 'Los servicios que ofrecen, señalando los requisitos para acceder a ellos', ''),
(20, 1, 'XX', 'Los trámites, requisitos y formatos que ofrecen', ''),
(21, 1, 'XXI', 'La información financiera sobre el presupuesto asignado, así como los informes del ejercicio trimestral del gasto, en términos de la Ley General de Contabilidad Gubernamental y demás normatividad aplicable', ''),
(22, 1, 'XXII', 'La información relativa a la deuda pública, en términos de la normatividad aplicable', ''),
(23, 1, 'XXIII', 'Los montos destinados a gastos relativos a comunicación social y publicidad oficial desglosada por tipo de medio, proveedores, número de contrato y concepto o campaña', ''),
(24, 1, 'XXIV', 'Los informes de resultados de las auditorías al ejercicio presupuestal de cada sujeto obligado y, en su caso, las aclaraciones que correspondan', ''),
(25, 1, 'XXV', 'El resultado de la dictaminación de los estados financieros', ''),
(26, 1, 'XXVI', 'Los montos, criterios, convocatorias y listado de personas físicas o morales a quienes, por cualquier motivo, se les asigne o permita usar recursos públicos o, en los términos de las disposiciones aplicables, realicen actos de autoridad. Asimismo, los informes que dichas personas les entreguen sobre el uso y destino de dichos recursos', ''),
(27, 1, 'XXVII', 'Las concesiones, contratos, convenios, permisos, licencias o autorizaciones otorgados, especificando los titulares de aquéllos, debiendo publicarse su objeto, nombre o razón social del titular, vigencia, tipo, términos, condiciones, monto y modificaciones, así como si el procedimiento involucra el aprovechamiento de bienes, servicios y/o recursos públicos', ''),
(28, 1, 'XXVII', 'La información sobre los resultados sobre procedimientos de adjudicación directa, invitación restringida y licitación de cualquier naturaleza, incluyendo la versión pública del expediente respectivo y de los contratos celebrados, que deberá contener, por lo menos, lo siguiente', ''),
(29, 1, 'XXIX', 'Los informes que, por disposición legal, generen los sujetos obligados', ''),
(30, 1, 'XXX', 'Las estadísticas que generen en cumplimiento de sus facultades, competencias o funciones con la mayor desagregación posible', ''),
(31, 1, 'XXXI', 'Informe de avances programáticos o presupuestales, balances generales y su estado financiero', ''),
(32, 1, 'XXXII', 'Padrón de proveedores y contratistas', ''),
(33, 1, 'XXXII', 'Los convenios de coordinación de concertación con los sectores social y privado', ''),
(34, 1, 'XXXIV', 'El inventario de bienes muebles e inmuebles en posesión y propiedad', ''),
(35, 1, 'XXXV', 'Las recomendaciones emitidas por los órganos garantes de Derechos Humanos, así como las acciones que han llevado a cabo para su atención', ''),
(36, 1, 'XXXVI', 'Las resoluciones y laudos que se emitan en procesos o procedimientos seguidos en forma de juicio', ''),
(37, 1, 'XXXVI', 'Los mecanismos de participación ciudadana', ''),
(38, 1, 'XXXVI', 'Los programas que ofrecen, incluyendo información sobre la población, objetivo y destino, así como los trámites, tiempos de respuesta, requisitos y formatos para acceder a los mismos', ''),
(39, 1, 'XXXIX', 'Las actas y resoluciones del Comité de Transparencia de cada sujeto obligado', ''),
(40, 1, 'XL', 'Todas las evaluaciones y encuestas que hagan los sujetos obligados a programas financiados con recursos públicos', ''),
(41, 1, 'XLI', 'Los estudios financiados con recursos públicos', ''),
(42, 1, 'XLII', 'El listado de jubilados y pensionados y el monto que reciben', ''),
(43, 1, 'XLIII', 'Los ingresos recibidos por cualquier concepto señalando el nombre de los responsables de recibirlos, administrarlos y ejercerlos, así como su destino, indicando el destino de cada uno de ellos', ''),
(44, 1, 'XLIV', 'Donaciones hechas a terceros en dinero o en especie', ''),
(45, 1, 'XLV', 'El catálogo de disposición y guía de archivo documental', ''),
(46, 1, 'XLVI', 'Las actas de sesiones ordinarias y extraordinarias, así como las opiniones y recomendaciones que emitan, en su caso, los consejos consultivos', ''),
(47, 1, 'XLVII', 'Para efectos estadísticos, el listado de solicitudes a las empresas concesionarias de telecomunicaciones y proveedores de servicios o aplicaciones de internet para la intervención de comunicaciones privadas, el acceso al registro de comunicaciones y la localización geográfica en tiempo real de equipos de comunicación, que contenga exclusivamente el objeto, el alcance temporal y los fundamentos legales del requerimiento, así como, en su caso, la mención de que cuenta con la autorización judicial correspondiente; y', ''),
(48, 1, 'XLVII', 'Cualquier otra información que sea de utilidad o se considere relevante, además de la que, con base en la información estadística, responda a las preguntas hechas con más frecuencia por el público', ''),
